script: |
  super -f text -I q3529.spq | sort > q3529.out

inputs:
  - name: q3529.spq
    data: |
      SELECT ALL col0 AS col2 FROM tab2 (FORMAT parquet) WHERE + col0 BETWEEN - col1 + 72 + - col2 + - col2 * + CAST ( - CAST ( col2 AS INTEGER ) * + CAST ( NULL AS INTEGER ) AS INTEGER ) AND NULL;
  - name: tab2

outputs:
  - name: q3529.out
    data: |
